const DocumentScreen = () => {
    return (
        <div className="text-center" style={{"background-color": "black"}}>
            <iframe title="Club_Doc" style={{"width": "50%", "height": "86vh"}} src="https://docs.google.com/document/d/e/2PACX-1vSbEKG9T7CIVYhahUfst-SKZ3WAm-cFBi3HOYEgROgzr5OLYMLujKGYtIQsaBVB08VBUonld0Vsv7hM/pub?embedded=true"></iframe>
        </div>
    )
}

export default DocumentScreen
